import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';

function App() {
  const [user, setUser] = useState(null);
  //const [progress, setProgress] = useState({ completed: 2, total: 3 });

  const handleLogin = (userData) => {
    setUser(userData);
  };

  const handleStartDisclosure = () => {
    alert("Starting or continuing disclosure flow...");
    // You can later extend this to route to your disclosure form or AI chat
  };

  return (
    <Router>
      <Routes>
        {/* Login route */}
        <Route path="/" element={<Login onLogin={handleLogin} />} />
        {/* Dashboard route */}
        <Route path="/dashboard" element={<Dashboard />} />
        {/* Add more Route tags for other screens */}
      </Routes>
    </Router>
  );


}

